import React, { useEffect } from "react";

const Admin2 = () => {
    const stdName = "ASHWINTH R";
    useEffect(async () => {
        const stdList = await fetch('http://localhost:3001/studentList');
        if(stdList){
        fetch(`http://localhost:3001/student/admin/${stdName}`)
        .then((res) => res.json())
        .then((res) => console.log(res))
        .catch((err) => console.log(err))}
    })
    return(
        <></>
    )
}

export default Admin2;
